import Divider from 'pages/home/Divider';
import React, { useState } from 'react';
import styled from 'styled-components';
import JobListContainer from './JobListContainer';

function WdlistPage() {
	const [isMoreJob, setIsmoreJob] = useState(false);

	return (
		<WdListPageComponent>
			<article className="navbar-category-container">
				<div className="navbar-categorymain">
					<MoreButton
						clicked={isMoreJob}
						onClick={() => {
							setIsmoreJob(!isMoreJob);
						}}
					>
						<span className="text-jobgroup-title">전체</span>
						<span className="btn-jobgroup">
							<svg
								xmlns="https://www.w3.org/2000/svg"
								width="12"
								height="12"
								viewBox="0 0 12 12"
							>
								<path
									fill="#666"
									fillRule="nonzero"
									d="M2.28 3.22a.75.75 0 0 0-1.06 1.06l4.25 4.25a.75.75 0 0 0 1.06 0l4.25-4.25a.75.75 0 0 0-1.06-1.06L6 6.94 2.28 3.22z"
								/>
							</svg>
						</span>
					</MoreButton>

					<div className="box-jobcategory">
						<span className="btn-jobcategorytitle-empty">
							직군을 선택해주세요.
						</span>
					</div>
				</div>
			</article>
			<JobListContainer />
		</WdListPageComponent>
	);
}

const MoreButton = styled.button`
	display: flex;
	align-items: center;
	white-space: nowrap;

	.text-jobgroup-title {
		padding-top: 3px;
		margin-right: 15.5px;
		font-size: 24px;
		line-height: 29px;
		font-weight: 700;
		color: #333;
	}
	.btn-jobgroup {
		transform: ${(props) => props.clicked && 'rotate(180deg)'};
		position: relative;
		border: 1px solid #e1e2e3;
		border-radius: 9999px;
		background-color: #fff;
		width: 26px;
		height: 26px;
		transition: 0.3s;
		flex-shrink: 0;
		svg {
			margin-top: 7px;
		}
	}
`;

const WdListPageComponent = styled.div`
	background: #fff;
	min-height: calc(100vh - 50px);
	overflow-x: hidden;

	.navbar-category-container {
		background: #fff;
		padding-top: 40px;
	}
	.navbar-categorymain {
		margin: 0 auto;
		width: 87.72%;
		position: relative;
		display: flex;
		max-width: 1060px;
		align-items: center;
	}

	.box-jobcategory {
		display: flex;
		align-items: center;
		white-space: nowrap;
		:before {
			content: '|';
			font-size: 28px;
			line-height: 29px;
			padding: 3px 24px 0;
			color: #ececec;
		}
	}
	.btn-jobcategorytitle-empty {
		padding-top: 3px;
		font-size: 24px;
		line-height: 29px;
		font-weight: 400;
		color: #aaa;
	}
`;

export default WdlistPage;
